import styled from "styled-components";
import logoduck from "../../assets/duck-head.png";

export default function Logo(){
    return (
        <LogoType>
        <p>Surf's</p>
        <img
        src={logoduck}
        />
        <p>Up</p>
    </LogoType>
    )
}

const LogoType = styled.div`
display: flex;
justify-content: center;
align-items: center;
padding: 10px;
height: 5%;
p{
    color: #68D2DF;
    font-family: 'Righteous';
    font-size: 30px;
}

img{
    width: 30px;
    height: 30px;
    margin: 0 5px 0 5px;
}
`
